import React from "react";
import styles from "./Card.module.css"

function Card({name,img,types}){

    return(
        <div className={styles.card}>
            <h3>{name}</h3>
            <img className={styles.cardImg} src={img} alt={name}></img>
            <p>{types?.map(e=>e).join("   ")}</p>
        </div>
    )
}

export default Card;
